import React from 'react';
import'./card.css';
function Cards (props, onClick) {
    return (
        <div onClick = {()=> props.newFriend(prop)} className="card" >
            <div className="img-container">
              <button><img alt={props.name} src={props.image} id={props.id}/></button>
            </div>
      </div>
    
    )
}

export default Cards;
